import React from 'react';
import c from './NavBar.module.css';
import img from'../../icons/icon.png'

function NavBar() {
    return (
        <nav className={c.nav}>
            <a href="#r" className={c.item}><img src="." alt=""/></a>
            <div className = {c.indent}></div>
            <a href="#r" className={c.item}>Messages</a>
            <div className = {c.indent}></div>
            <a href="#r" className={c.item}>News</a>
            <div className = {c.indent}></div>
            <a href="#r" className={c.item}>Music</a>
            <div className = {c.indent}></div>
            <a href="#r" className={c.item}>Settings</a>
        </nav>
    )
}

export default NavBar;
